import "./App.css";
 import React from 'react';
 import { Routes, Route, Link } from "react-router-dom";
 import Mercury from "./components/Mercury";
 import data from "./data.json"

 function App() {

    let mercury = data[0]
    let venus = data[1]
    let earth = data[2]
    let mars = data[3]
    let jupiter = data[4]
    let saturn = data[5]
    let uranus = data[6]
    let neptune = data[7]

    let planets = [mercury, venus, earth, mars, jupiter, saturn, uranus, neptune]



     return (
<div>
    <nav>
        <h2>THE PLANETS</h2>
        <ul>
            <li>MERCURY</li>
            <li>VENUS</li>
            <li>EARTH</li>
            <li>MARS</li>
            <li>JUPITER</li>
            <li>SATURN</li>
            <li>URANUS</li>
            <li>NEPTUNE</li>
        </ul>
    </nav>

    <Mercury
        name={mercury}
        overview={merc}


    />

{planets[0].name}



</div>
     );
 }

 export default App;
